import Banner from '../components/Banner';

const Home = () => {
	return (
		<>
			<Banner />
			<div class='max-w-5xl mx-auto'>
				<h3 class='text-2xl font-semibold text-gray-700'>Book unique homes and experiences</h3>
			</div>
		</>
	);
};

export default Home;
